    "quotes": "\"Je n'ai rien d'autre à offrir que du sang, de la peine, des larmes et de la sueur.\" Winston Churchill\n\n« S'il n'y avait pas d'hiver, le printemps ne serait pas si agréable : si nous ne goûtions pas à l'adversité, la réussite ne serait pas tant appréciée. » Anne Bradstreet\n\n\n« Là où la volonté est grande, les difficultés diminuent. » Nicolas Machiavel\n\n\n\"Personne ne vous donne la liberté, vous y croyez et vous la prenez.\"  Kathy Acker\n\n\"Brisez vos limites, faites sauter les barrières de vos contraintes, mobilisez votre volonté, exigez la liberté comme un droit, soyez ce que vous voulez être. Découvrez ce que vous aimeriez faire et faites tout votre possible pour y parvenir.\" \n\"Tu es toujours libre de changer d'idée et de choisir un avenir différent, ou un passé différent.\"\nRichard Bach\n\n\"Que préfères-tu, celui qui veut te priver de pain au nom de la liberté ou celui qui veut t'enlever ta liberté pour assurer ton pain ?\" Albert Camus\n\n\" oh, non l'homme ne descend pas du singe, il descend plutôt du mouton\" Saez, J'accuse\n\n\"J'aimerais mieux que mon étincelle brûle avec une brillante flamme, plutôt qu'elle soit étouffée par la sécheresse de la pourriture, j'aimerais mieux être un superbe météore, chacun de mes atomes irradiant d'un magnifique éclat, plutôt qu'une planète endormie.\" Jack London\n\n\"Mais de tout cela vous en vous en rendrez compte très vite. A bientôt donc mon idiot de semblable, mon crétin de frère, mon stupide cousin. Sois donc soulagé: désormais, dans le désert de ta connerie qui est infinie, tu ne seras plus jamais seul.\"",
